import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

function NavBar({ cards, setCards }) {
  const navigate = useNavigate();

  const handleSignout = () => {
    navigate('/login');
  };

  const handleFilter = (e) => {
    const filter = cards.filter((item) => item.location.includes(e.target.value));
    setCards(filter);
  };

  return (
    <nav>
      <div className="navbar-container">
        <Link exact to="/main" className="navbar-link">
          L L H
        </Link>
        <Link to="/messages" className="navbar-link">
          Messages
        </Link>
        <Link to="/logout" className="navbar-link" onClick={handleSignout}>
          Signout
        </Link>
        <Link to="/profile" className="navbar-link" onClick={() => console.log('Profile clicked')}>
          Profile
        </Link>
        <Link to="/account" className="navbar-link" onClick={() => console.log('Account clicked')}>
          Account
        </Link>
        <label className="navbar-label">Search location:</label>
        <input type="search" placeholder="Location" className="navbar-input" onChange={handleFilter} />
      </div>
      <hr className="navbar-divider" />
    </nav>
  );
}

export default NavBar;
